import { React } from 'react';
import H1title from '../Components/H1title';
import { NavLink } from 'react-router';

let homeTitle = {
  title: 'HRnet',
};

const Home = () => {
  return (
    <div className='pageWrapper'>
      <H1title {...homeTitle}></H1title>
      <NavLink to='/employee-list'>View Current Employees</NavLink>;
    </div>
  );
};

export default Home;
